const initialState = ['apple', 'banana', 'cherry'];
const [fruits, setFruits] = useState(initialState);

export default function Fruits() {
    return (
        <div>
            <h1>My favorite fruits</h1>
            <ul>
                {fruits.map(fruit => (
                    <li key={fruit}>{fruit}</li>
                ))}
            </ul>
        </div>
    );
}
